import Typed from "typed.js";

export default function heroLogic() {
  const dynamicTextOption = {
    strings: ["I am anait graduate", "coder", "dungeon master", "cat mom", "coffee addict"],
    typeSpeed: 40,
    backSpeed: 20,
    loop: true,
    smartBackspace: true,
  };

  const dynamicText = new Typed(".hero-h1-dynamic-text", dynamicTextOption);
}
